tc_game_scripts.script_contents:
IF EXIST __CoDUOMP (
  attrib -h __CoDUOMP
  del __CoDUOMP
)

for /d %%f in (*) do (
  IF EXIST %%f%\__CoDUOMP (
    attrib -h %%f%\__CoDUOMP
    del %%f%\__CoDUOMP
  )
  IF EXIST %%f%\uoconfig_mp.cfg (
    del %%f%\uoconfig_mp.cfg
  )
)
